import { Location } from '@angular/common';
import { Component, Input, OnInit } from '@angular/core';
import { FormControl, FormGroup, Validators } from '@angular/forms';
import { UserService } from 'src/app/services/user.service';

@Component({
  selector: 'app-create-group',
  templateUrl: './create-group.component.html',
  styleUrls: ['./create-group.component.css'],
})
export class CreateGroupComponent implements OnInit {
  createGroupForm = new FormGroup({
    groupName: new FormControl('', Validators.required),
    userIds: new FormControl<number[]>([]),
  });
  users!: { id: number; username: string }[];
  selectedUsers: number[] = [];
  constructor(private location: Location, private userService: UserService) {}
  ngOnInit(): void {
    this.userService.getUsers().subscribe((result) => {
      console.log('result: ', result);
      this.users = result;
    });
  }
  submitForm(): void {
    console.log('Form data:', this.createGroupForm.value);
    // Add your form submission logic here
  }
  goBack() {
    this.location.back();
  }

  toggleSelection(userId: number) {
    if (this.selectedUsers.includes(userId)) {
      this.selectedUsers = this.selectedUsers.filter(
        (item) => item !== userId
      );
    } else {
      this.selectedUsers.push(userId);
    }
    this.createGroupForm.get('userIds')?.setValue(this.selectedUsers);
    console.log('this.selectedGroupMembers: ', this.selectedUsers);
  }

  get userIds() {
    return this.createGroupForm.get('userIds');
  }

  get groupName(){
    return this.createGroupForm.get('groupName');
  }
}
<div class="row mb-4 mt-4">
  <div class="col-auto">
    <button type="button" class="btn btn-primary rounded-circle" title="Back" (click)="goBack()">
      <i class="bi bi-arrow-left" style="font-size: 1.5rem; color: white"></i>
    </button>
  </div>
  <div class="col text-center">
    <span class="display-4">Create new group</span>
  </div>
</div>
<div class="row">
<div class="col"></div>
<div class="col-md-5">
    <form [formGroup]="createGroupForm" (ngSubmit)="submitForm()">
      <div class="row mb-2">
        <div class="col">
          <div class="form-group">
            <label for="groupName">Group name</label>
            <input
              type="text"
              class="form-control"
              id="groupName"
              name="groupName"
              formControlName="groupName"
              required
            />
            <div
              *ngIf="groupName?.invalid && (groupName?.dirty || groupName?.touched)"
              class="alert alert-danger"
            >
              <div *ngIf="groupName?.errors?.['required']">Name is required.</div>
            </div>
          </div>
        </div>
      </div>
      <div class="row  mb-2">
        <div class="col">
          <ng-container *ngIf="true">
            <ng-container *ngFor="let user of users">
              <div class="form-check form-check-reverse card mb-2">
                <div class="card-body d-flex justify-content-between">
                  <label class="form-check-label" for="userIds">
                    {{ user.username }}
                  </label>
                  <input
                    class="form-check-input"
                    type="checkbox"
                    [value]="user.id"
                    id="userIds"
                    (change)="toggleSelection(user.id)"
                  />
                </div>
              </div>
            </ng-container>
          </ng-container>
          <div
          *ngIf="userIds?.invalid"
          class="alert alert-danger"
        >
          <div *ngIf="userIds?.errors?.['required']">You have to choose at least one person</div>
          <div *ngIf="userIds?.errors?.['minLength']">You have to choose at least one person</div>
        </div>
        <div>{{createGroupForm.invalid}}</div>
        </div>
      </div>
      <button type="submit" class="btn btn-primary" [disabled]="!createGroupForm.valid">Create</button>
    </form>
</div>
<div class="col"></div>
</div>
